                                            var _paramJson = treeconfig.tree.tree.addNode;
                                            if (_paramJson) {

                                                var obj = new Object();
                                             // obj.${id} ={
                                               //     id:_paramJson.id,
                                               //     text:_paramJson.name
                                              //  };
						 obj.${id} =_paramJson.name;
                                                formPlane.fillValues(obj, '${formId}');
                                           }
                                        }
                                    }
                                    nsFrame.popPageConfig(_config);
                                },
                                localDataConfig : [ {
                                    key : 'id',
                                    primaryKey : true
                                }, {
                                    key : 'name',
                                    title : '组织结构',
                                }, {
                                    key : '',
