{
		text: '保存',
		handler: function(){
			var _data = nsForm.getFormJSON('${formId}');
			if (_data) {
				$.ajax({
					data: _data,
					url: getRootPath() + '/netStarRights/${saveUrl}.json',
					type: 'post',
					success: function (data) {
						if (data.success) {
							nsalert('保存成功', 'success');
							<#if tableId?? && tableId!=''>
							<#if tableParams?? && tableParams!=''>
								baseDataTable.reloadTableAJAX('${tableId}',${tableParams});
							<#else>
								baseDataTable.reloadTableAJAX('${tableId}');
							</#if>
							</#if>
							if($('#wf_workItemId')&&data.data&&data.data.workItemId!=null){
								console.info("设置 workItemId");
								$('#wf_workItemId').val(data.data.workItemId);
							}
							if($('#wf_instanceId')&&data.data&&data.data.instanceId!=null){
								console.info("设置 instanceId");
								$('#wf_instanceId').val(data.data.instanceId);
							}
							if($('#wf_workItemState')&&data.data&&data.data.workItemState!=null){
								console.info("设置 workItemState");
								$('#wf_workItemState').val(data.data.workItemState);
							}
							if($('#wf_activityName')&&data.data&&data.data.activityName!=null){
								console.info("设置 activityName");
								$('#wf_activityName').val(data.data.activityName);
							}
								console.info("$('#wf_fowardMode'):"+$('#wf_fowardMode'));
								console.info("data.data.fowardMode:"+data.data.fowardMode);
							if($('#wf_fowardMode')&&data.data&&data.data.fowardMode!=null){
								console.info("设置 fowardMode");
								$('#wf_fowardMode').val(data.data.fowardMode);
							}
							<#if mainFromInfoId?? && mainFromInfoId!=''>
								if(data&&data.data){
									if(data.data.ID){
                                                            $('#mainFormDataId').val(data.data.ID);
                                                        }else if(data.data.id){
                                                            $('#mainFormDataId').val(data.data.id);
                                                        }
								}
							</#if>
							formPlane.fillValues(data.data,'${formId}');
						} else {
							var _errStr = data.msg
							nsalert('保存失败，请重试 ' + _errStr, 'error');
						}
					},
					error: function (e) {
						nsalert('保存失败，请重试', 'error');
					}
				})
			}
		}
}

