var btns={
	<#if title??&&title!=''>
		title:'${title}',
	</#if>
	<#if showAdd?? && showAdd=='1'>
	addBtn:  function() {
		popupBox.initShow(_${dialogId}Dialog);
		<#if subTableFormIdFieldName?? && subTableFormIdFieldName!='' && parentInfoInputId?? && parentInfoInputId!='' && subTableFormId?? && subTableFormId!=''>
		var _formValueJson = {'${subTableFormIdFieldName}':$('#${parentInfoInputId}').val()};
		console.info(JSON.stringify(_formValueJson));
		formPlane.fillValues(_formValueJson,'${subTableFormId}');
		</#if>
	},
	</#if>
	<#if showModify?? && showModify=='1'>
	modifyBtn: function() {
		var _row = baseDataTable.getSingleRowSelectedData('${tableId}');
		if (!_row) {
			return false;
		}
		popupBox.initShow(_${dialogId}Dialog);
		formPlane.fillValues(_row, '${dialogId}');
	},
	</#if>
	<#if showDelete?? && showDelete=='1'>
	delBtn: function() {
		var _row = baseDataTable.getSingleRowSelectedData('${tableId}');
		if (!_row) {
			return false;
		}
		var isDel = confirm("是否确认删除？");
		if (!isDel) {
			return false;
		}
		var id = null;
		if(_row.id){
			id = _row.id;
		}else if(_row.ID){
			id = _row.ID;
		}else{
			nsalert('获取记录id信息失败','error');
		}
		$.ajax({
<#if bindTableInfo?? && bindTableInfo!=''>
			data: {id: id,tableInfoId:${bindTableInfo}},
<#else>
			data: {id:id},
</#if>
			url: getRootPath() + '/netStarRights/${delUrl}.json',
			type: 'post',
			success: function (data) {
				if (data.success) {
					nsalert('删除成功', 'success');
					baseDataTable.reloadTableAJAX('${tableId}');
				} else {
					var errStr = data.msg
					nsalert('删除失败，请重试 ' + errStr, 'error');
				}
			},
			error: function (e) {
				nsalert('删除失败，请重试', 'error');
			}
		})
	},
	</#if>
	selfBtn:[
			<#list scripts as script>
				${script},
			</#list>
	]	
}

