rows.templateJs:
{
		text: '保存',
		handler: function(){
			var _data = nsForm.getFormJSON('${formId}');
			if (_data) {
				$.ajax({
					data: _data,
					url: getRootPath() + '/netStarRights/${saveUrl}.json',
					type: 'post',
					success: function (data) {
						if (data.success) {
							nsalert('保存成功', 'success');
							<#if tableId?? && tableId!=''>
							<#if tableParams?? && tableParams!=''>
								baseDataTable.reloadTableAJAX('${tableId}',${tableParams});
							<#else>
								baseDataTable.reloadTableAJAX('${tableId}');
							</#if>
							</#if>

							<#if mainFromInfoId?? && mainFromInfoId!=''>
								if(data&&data.data){
									$('#${mainFromInfoId}').val(data.data.id);
								}
							</#if>
							formPlane.fillValues(data.data,'${formId}');
							popupBox.hide();
						} else {
							var _errStr = data.msg
							nsalert('保存失败，请重试 ' + _errStr, 'error');
						}
					},
					error: function (e) {
						nsalert('保存失败，请重试', 'error');
					}
				})
			}
		}
}

